import React from 'react'
import './Header.css';
import HomeIcon from '@material-ui/icons/Home';



function Header() {
    return (
        <div className="Header__part">
            <div className="Header__bar">
                <HomeIcon title="Home"/>

                <h3>Booking</h3>
           </div>
        </div>
    )
}

export default Header
